import React from 'react'
import Manifest from './main-hero.json'
import Boxing from '../boxing-ring.jpeg'

const CTA = () => {
    return (
        <div className='flex space-x-5'>
            <button className='select-none text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white active:opacity-0 transform transition hover:scale-110 duration-300 ease-in-out'>Join presale</button>
            <button className='select-none text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white bg-opacity-20 active:bg-black text-white transform transition hover:scale-110 duration-300 ease-in-out'>Watch live</button>
        </div>
    )
}

const LandingParagraph = () => {
    return (
        <div className='font-extrabold text-4xl md:text-7xl'>{Manifest.motto}</div>
    )
}

const LandingImage = () => {
    return (
        <img src={Boxing} alt='boxing' className='filter contrast-125 brightness-100 drop-shadow-lg object-cover'/>
    )
}

const Landing = () => {
    return (
    <div className='grid grid-flow-row md:grid-flow-col h-screen text-white bg-black p-10 overflow-hidden'>
        <div className='flex flex-col self-center h-full justify-center relative z-10 space-y-10'>
            <div><LandingParagraph /></div>
            <div><CTA /></div>
        </div>
        <div className='overflow-hidden -m-10 md:m-10 md:scale-100 self-start md:self-center transform scale-150'><LandingImage /></div>
    </div>
    )
}

export default Landing


